import React from 'react'

const Sidebar = () => {
    return (
        <nav className="w-full  p-5">
            <div>
                <img
                    className="rounded-full  w-12 h-12 object-cover"
                    src="https://images.unsplash.com/photo-1499952127939-9bbf5af6c51c?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1176&q=80" alt="" />
            </div>
        </nav>
    )
}

export default Sidebar
